new Runnable(){
  @Override public void run(){
    E entry=entries.get(entryName);
    if (entry != null) {
      entry.aquire();
      semaphore.release();
      entry.getPromise().addListener(new TransferListener<E>(newPromise));
      return;
    }
    E value=createEntry(newPromise);
    value.aquire();
    E oldValue=entries.putIfAbsent(entryName,value);
    if (oldValue != null) {
      oldValue.aquire();
      semaphore.release();
      oldValue.getPromise().addListener(new TransferListener<E>(newPromise));
      return;
    }
    RedisPubSubListener<Object> listener=createListener(channelName,value);
    connectionManager.subscribe(LongCodec.INSTANCE,channelName,listener,semaphore);
  }
}

new FutureListener<R>(){
  @Override public void operationComplete(  Future<R> future) throws Exception {
    if (!future.isSuccess()) {
      mainPromise.tryFailure(future.cause());
      return;
    }
    R result=future.getNow();
    if (result instanceof Collection) {
synchronized (results) {
        results.addAll((Collection)result);
      }
    }
 else {
synchronized (results) {
        results.add(result);
      }
    }
    if (counter.decrementAndGet() == 0 && !mainPromise.isDone()) {
      mainPromise.setSuccess(results);
    }
  }
}

new FutureListener<T>(){
  @Override public void operationComplete(  Future<T> future) throws Exception {
    if (!future.isSuccess()) {
      mainPromise.tryFailure(future.cause());
      return;
    }
    if (callback != null) {
      callback.onSlotResult(future.getNow());
    }
    if (counter.decrementAndGet() == 0) {
      if (callback != null) {
        mainPromise.setSuccess(callback.onFinish());
      }
 else {
        mainPromise.setSuccess(null);
      }
    }
  }
}

